    ,f_editarCuestionario:function(la_data){
        try{
            return $.ajax({
                url: BASE_URL+'catalogo-general/edit-cuestionario',
                type: "POST",
                data:{"data":la_data}
            });
        } catch (exception) {
            console.log(exception);
        }
    },
    f_nuevoCuestionario:function(la_data){
        try{
            return $.ajax({
                url: BASE_URL+'catalogo-general/nuevo-cuestionario',
                type: "POST",
                data:{"data":la_data}
            });
        } catch (exception) {
            console.log(exception);
        }
    },
    f_eliminarCuestionario:function(id_cuestionario){
        try{
            return $.ajax({
                url: BASE_URL+'catalogo-general/delete-cuestionario',
                type: "POST",
                data:{"id_cuestionario":id_cuestionario}
            });
        } catch (exception) {
            console.log(exception);
        }
    }
